import React from "react";
import "./navbar.css";

function Navbar() {
  return (
    <nav className="nav-bar">
      <div className="nav">
        <div className="left-nav">
          <h1>Logo</h1>
        </div>
        <div className="right-nav">
          <a>A</a>
          <a>B</a>
          <a>C</a>
          <a>D</a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
